        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-1729812583":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"image\",\"icon\":\"plus\",\"color\":\"#981d99\",\"hotspots\":[{\"position\":{\"x\":17.2,\"y\":52.732280766046394},\"alwaysFullscreen\":true,\"content\":[{\"params\":{\"text\":\"<p> </p>\\n\\n<p></p>\\n\\n<p>Arduino IDE (Integrated Development Environment) es un entorno de desarrollo de software que permite escribir, crear y depurar programas en placas Arduino. Esta plataforma utiliza un lenguaje de programación basado en C++ y se ha consolidado como una de las herramientas más accesibles para introducir a los estudiantes en la lógica de la programación y el control de dispositivos físicos. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8335d4ee-4904-453e-bd6f-ea07ef5ba98f\"}],\"header\":\"ARDUINO IDE\"},{\"position\":{\"x\":84,\"y\":53.63006207274093},\"alwaysFullscreen\":true,\"content\":[{\"params\":{\"text\":\"<p>Fritzing es una herramienta de diseño electrónico que permite a los estudiantes crear esquemas de circuitos visualmente, utilizando representaciones gráficas de placas, cables, resistencias, LEDs y otros componentes. Esta plataforma resulta especialmente útil para planificar y documentar montajes de circuitos antes de implementarlos físicamente, facilitando la comprensión de conexiones y estructuras electrónicas.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7010ed80-0555-4fbd-8946-e6aaf32281dd\"}],\"header\":\"FRITZÍNG\"},{\"position\":{\"x\":47.599999999999994,\"y\":18.15002759793875},\"alwaysFullscreen\":true,\"content\":[{\"params\":{\"text\":\"<p>Una plataforma de programación es un entorno o sistema que proporciona las herramientas y recursos necesarios para que los desarrolladores puedan crear, probar y ejecutar programas de software mediante un lenguaje de programación específico.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sin título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"469924b2-8376-4871-b348-5318c41b4b04\"}],\"header\":\"Plataformas de Programación\"}],\"hotspotNumberLabel\":\"Punto clave #num\",\"closeButtonLabel\":\"Cerrar\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"image\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/4gHYSUNDX1BST0ZJTEUAAQEAAAHIAAAAAAQwAABtbnRyUkdCIFhZWiAH4AABAAEAAAAAAABhY3NwAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQAA9tYAAQAAAADTLQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAlkZXNjAAAA8AAAACRyWFlaAAABFAAAABRnWFlaAAABKAAAABRiWFlaAAABPAAAABR3dHB0AAABUAAAABRyVFJDAAABZAAAAChnVFJDAAABZAAAAChiVFJDAAABZAAAAChjcHJ0AAABjAAAADxtbHVjAAAAAAAAAAEAAAAMZW5VUwAAAAgAAAAcAHMAUgBHAEJYWVogAAAAAAAAb6IAADj1AAADkFhZWiAAAAAAAABimQAAt4UAABjaWFlaIAAAAAAAACSgAAAPhAAAts9YWVogAAAAAAAA9tYAAQAAAADTLXBhcmEAAAAAAAQAAAACZmYAAPKnAAANWQAAE9AAAApbAAAAAAAAAABtbHVjAAAAAAAAAAEAAAAMZW5VUwAAACAAAAAcAEcAbwBvAGcAbABlACAASQBuAGMALgAgADIAMAAxADb/2wBDAAEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQH/2wBDAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQH/wAARCAfQBHgDAREAAhEBAxEB/8QAHwAAAQMFAQEBAAAAAAAAAAAAAgEDBgAEBQcICQoL/8QAXxAAAQIDBQUFBQYEBAUBAwAbAQIRAwQhAAUSMUEGIlFhcQcTMoGRFEKhsfAII1LB0eEVM2LxCSRDchY0U2OCkhclRHODogqTsiZUZKPCGLPD0tM1RXSE4uPy80ZlpP/EAB4BAAEFAQEBAQEAAAAAAAAAAAABAgMEBQYHCAkK/8QAVBEAAQIEAwYEBQMDAwMCAQIXAREhAAIxQQNRYQQFEnGBkaGxwfAGEyLR4Qcy8RRCUhUjYggzchYkgkOSNKKywhc1RFMlY3N00jZU4mSDk/Imo7P/2gAMAwEAAhEDEQA/APl2hJK3AbM55NTO3pIBJQRXi5EIE1DevwFLTwQ53QqAdPF/p/pYgghDBo
